function get_exdata_slot_by_mail(mail) {

    let slot = null;
    let test_mail = mail.toLowerCase().trim();
    for (let i=0; i<mord_exdata.length; i++)
        if (mord_exdata[i].mail === test_mail)
        {
            slot = mord_exdata[i];
            break;
        }

    if (null === slot)
    {
        console.log("get_exdata_slot_by_mail: no exdata slot found for mail " + mail);
    }


    return slot;
}

