function getUrlValue($param){
    let $x = location.search.indexOf($param+"=");
    if ($x !== -1) {
        $x = location.search.substring(location.search.indexOf($param + "=") + $param.length + 1);
        if ($x && $x.indexOf("&") !== -1) $x = $x.substring(0, $x.indexOf("&"));
    }
    if ($x && $x !== -1) return $x;
    else return null;
}
