function validate_email($src) {
    if (!$src)
        return false;
    else
    {
        let mail = $src.split("@");
        if (mail.length === 2)
        {
            if (mail[0].length > 0)
            {
                if (mail[1].length >= 3)
                {
                    let r = mail[1].split(".");
                    if (r.length >= 2)
                    {
                        if (r[r.length - 1]) // domain is ok
                            return true;
                        else
                            return false;
                    }
                    else
                        return false;
                }
                else
                    return false;
            }
            else
                return false;
        }
        else
            return false;
    }
}
