function count_mail_resp_dupes() {
    let resp_list = [];


    $ad.qzs[5].resps.forEach(function (v_gr) {
        v_gr.forEach(function (v_resp) {
            let resp = $ad.resps[get_resp_ord_from_resp_id(v_resp.id)];
            let found = false;
            if (resp_list.length)
                for (let i=0; i<resp_list.length; i++)
                    if (resp_list[i].mail === resp.mail.toLowerCase())
                    {
                        found = true;
                        if (resp_list[i].id_list.indexOf(resp.id) === -1)
                            resp_list[i].id_list.push(resp.id);
                    }

            if (!found)
            {
                resp_list.push({
                    fio: resp.fio,
                    mail: resp.mail.toLowerCase(),
                    id_list: [resp.id]
                });
            }
        });

    });
    let dup_qnt = 0;
    let dup_mail_list = [];
    resp_list.forEach(function(v){
        if (v.id_list.length > 1)
        {
            dup_qnt++;
            dup_mail_list.push(v.mail);
        }

    });
    console.log(resp_list);
    console.log("dup_qnt: " + dup_qnt);
    console.log("dup_mail_list: ", dup_mail_list);
}
