function get_comp_id_list_from_qst_list(qst_list, tag) {
    let comp_list = null;
    let bulks_list = null;
    let names_list = null;
    if (qst_list.length)
    {
        // ID's LIST
        comp_list = [];
        qst_list.forEach(function (qid) {
            let comp_id = get_comp_id_from_qst_id(qid);
            if (null !== comp_id && comp_list.indexOf(comp_id) === -1)
                comp_list.push(comp_id);
        });

        if ("qst_qnt" === tag)
        {
            bulks_list = [];
            qst_list.forEach(function (qid) {
                let comp_id = get_comp_id_from_qst_id(qid);
                let local_comp_ord = comp_list.indexOf(comp_id);
                if (!bulks_list.hasOwnProperty(local_comp_ord))
                    bulks_list[local_comp_ord] = 0;

                bulks_list[local_comp_ord]++;
            });
        }
        else
        if ("comp_names" === tag)
        {
            names_list = [];
            comp_list.forEach(function (v_comp_id) {

                let g_ord = get_comp_ord_from_comp_id(v_comp_id);
                names_list.push($ad.comps[g_ord].name);
            });
        }
    }
    // List of unique comp_id's
    if ("qst_qnt" === tag)
        return bulks_list;
    else
    if ("comp_names" === tag)
        return names_list;
    else
        return comp_list;
}
