function secure_tx(tx, revert) {
    let secured_tx = tx;
    if (!revert)
    {
        secured_tx = secured_tx.replace(/"/g,"!1!");
        secured_tx = secured_tx.replace(/'/g,"!2!");
        secured_tx = secured_tx.replace(/\\/g,"!3!");
    }
    else
    {
        secured_tx = secured_tx.replace(/!1!/g,"\"");
        secured_tx = secured_tx.replace(/!2!/g,"'");
        secured_tx = secured_tx.replace(/!3!/g,"\\");
    }
    return secured_tx;
}
